INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 2, 24001, 10046, 401, "2030/12/17 14:59:59", 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24002, 10046, 402, "2030/12/17 14:59:59", 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", 2.21);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 2, 24003, 10046, 403, "2030/12/17 14:59:59", 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 1, 24004, 10046, 701, "2030/12/17 14:59:59", 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", 1.99);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24005, 10046, 702, "2030/12/17 14:59:59", 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", 2.21);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 1, 24006, 10046, 703, "2030/12/17 14:59:59", 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", 3.33);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 2, 24007, 10046, 801, "2030/12/17 14:59:59", 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24008, 10046, 802, "2030/12/17 14:59:59", 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", 2.68);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 2, 24009, 10046, 803, "2030/12/17 14:59:59", 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 1, 24010, 10046, 501, "2030/12/17 14:59:59", 192501, "やった！", "", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 1, 24011, 10046, 502, "2030/12/17 14:59:59", 192501, "勝ったよ！", "", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 1, 24012, 10046, 503, "2030/12/17 14:59:59", 192501, "いい調子！", "", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 6, 0.0, 2, 24013, 10046, 111, "2030/12/17 14:59:59", 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", 5.33);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24014, 10046, 112, "2030/12/17 14:59:59", 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", 6.85);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24015, 10046, 113, "2030/12/17 14:59:59", 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", 3.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24016, 10046, 611, "2030/12/17 14:59:59", 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", 6.11);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24017, 10046, 612, "2030/12/17 14:59:59", 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", 6.75);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 2, 24018, 10046, 613, "2030/12/17 14:59:59", 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 1, 24019, 10046, 211, "2030/12/17 14:59:59", 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", 4.52);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 1, 24020, 10046, 212, "2030/12/17 14:59:59", 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", 3.89);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24021, 10046, 213, "2030/12/17 14:59:59", 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", 13.49);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24022, 10046, 311, "2030/12/17 14:59:59", 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", 3.17);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24023, 10046, 312, "2030/12/17 14:59:59", 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", 4.42);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 6, 0.0, 1, 24024, 10046, 313, "2030/12/17 14:59:59", 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", 2.89);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 4, 0.0, 3, 24025, 10046, 421, "2030/12/17 14:59:59", 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", 3.71);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 2, 0.0, 1, 24026, 10046, 721, "2030/12/17 14:59:59", 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", 5.1);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 3, 24027, 10046, 821, "2030/12/17 14:59:59", 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", 4.34);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (0.0, "2020/07/31 12:00:00", 24, 1, 0.0, 1, 24028, 10046, 521, "2030/12/17 14:59:59", 192501, "いい勝負だったよ\nまたやろうね", "", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (-360.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24029, 10046, 101, "2030/12/17 14:59:59", 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", 5.62);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (-360.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24030, 10046, 102, "2030/12/17 14:59:59", 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", 9.58);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (-360.0, "2020/07/31 12:00:00", 24, 2, 0.0, 2, 24031, 10046, 103, "2030/12/17 14:59:59", 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (-360.0, "2020/07/31 12:00:00", 24, 2, 0.0, 1, 24032, 10046, 104, "2030/12/17 14:59:59", 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", 9.13);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES (-360.0, "2020/07/31 12:00:00", 24, 1, 0.0, 2, 24033, 10046, 105, "2030/12/17 14:59:59", 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", 8.27);
